import StackedExample from './components/Nav.jsx';
import UncontrolledExample from './components/fondo.jsx';
import Subscription from './components/prueba.jsx';
import Footer from './components/footer';

function App() {
  return (
    <BrowserRouter>
        <div className="App">
          <Switch>
            <Route exact path="/" component={StackedExample} />
            <Route exact path="/fondo" component={UncontrolledExample} />
            <Route exact path="/prueba" component={Subscription} />

            </Switch>
    </div>
    </BrowserRouter>



  );
}

export default App;
